import React from 'react';
import './App.css';
import { Navbar } from './Components/Navbar/Navbar'; // Importing Navbar
import { BrowserRouter, Routes, Route } from 'react-router-dom'; // Importing BrowserRouter for routing
import { ShopCategory } from './Pages/ShopCategory'; // Importing ShopCategory
import { LoginSignup } from './Pages/LoginSignup'; // Importing LoginSignup
import { Cart } from './Pages/Cart'; // Importing Cart
import { Product } from './Pages/Product'; // Importing Product
import { Shop } from './Pages/Shop'; // Importing Shop
import Header from './Pages/Header'; // Importing Header
import Wishlist from './Pages/Wishlist'; // Import Wishlist page

function App() {
  return (
    <BrowserRouter>
      <Header /> {/* Header with Wishlist button */}
      <Navbar /> {/* Your Navbar */}

      <Routes>
        {/* Main Shop Page */}
        <Route path="/" element={<Shop />} />

        {/* Category Pages */}
        <Route path="/mens" element={<ShopCategory category="mens" />} />
        <Route path="/womens" element={<ShopCategory category="womens" />} />
        <Route path="/kids" element={<ShopCategory category="kids" />} />

        {/* Product Page */}
        <Route path="/product/:productId" element={<Product />} />

        {/* Cart Page */}
        <Route path="/cart" element={<Cart />} />

        {/* Login/Signup Page */}
        <Route path="/login" element={<LoginSignup />} />

        {/* Wishlist Page */}
        <Route path="/wishlist" element={<Wishlist />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
